import React from "react";

const BookMark = ({ status }) => {
  return (
    <button>
      {status === false ? (
        <i className="bi bi-bookmark"></i>
      ) : (
        <i className="bi bi-bookmark-fill"></i>
      )}
    </button>
  );
};

export default BookMark;
